  void sort_range(int *sorted, int a, int b, int* temp)
  {
  if (a >= b)
  return;
  int mid = (a + b)  / 2;
  sort_range(sorted, a, mid, temp);
  sort_range(sorted, mid + 1, b, temp);
  int i = 0;
  int m = a;
  int n = mid + 1;

  while(m <= mid && n <= b)
  {
  temp[i ++] = sorted[m] > sorted[n] ?
  sorted[n ++] : sorted[m ++];
  }

  while (m <= mid)
  temp[i ++] = sorted[m ++];
  while (n <= b)
  temp[i ++] = sorted[n ++];
  memcpy(&sorted[a], temp, (b - a + 1) * sizeof(int));
  }

  int* sort_fast(int *num, int numSize)
  {
  int *sorted = malloc(sizeof(int) * numSize);
  memcpy(sorted, num, sizeof(int) * numSize);
  int *temp = malloc(sizeof(int) * numSize);
  sort_range(sorted, 0, numSize - 1, temp);
  free(temp);
  return sorted;
  }

