#include "./10_regular_expression_matching.h"
void test_10()
{
    char* s = "aa";
    char* p = "aa";
    printf("s %s p %s %d.\n", s, p, isMatch(s,p));
    s = "aab"; p = "c*a*b";
    printf("s %s p %s %d.\n", s, p, isMatch(s,p));
    s = "aa"; p = "a";
    printf("s %s p %s %d.\n", s, p, isMatch(s,p));
    s = "aaa"; p = "aa";
    printf("s %s p %s %d.\n", s, p, isMatch(s,p));
    s = "aa"; p = "a*";
    printf("s %s p %s %d.\n", s, p, isMatch(s,p));
    s = "aa"; p = "aa*";
    printf("s %s p %s %d.\n", s, p, isMatch(s,p));
    s = "aa"; p = ".*";
    printf("s %s p %s %d.\n", s, p, isMatch(s,p));
    s = "ab"; p = ".*";
    printf("s %s p %s %d.\n", s, p, isMatch(s,p));
    s = "bccbbabcaccacbcacaa";
    p = ".*b.*c*.*.*.c*a*.c";
    printf("s %s p %s %d.\n", s, p, isMatch(s,p));
}

