void gen(int s, int e, int k, int* temp, int tl)
{
    if (!k)
        out(temp, tl);
    else
    {
        for(int i = s; i <= e - k + 1; i ++)
        {
            temp[tl] = i;
            gen(i + 1, e, k - 1, temp, tl + 1);
        }
    }
}

