bool isU(int num) {
    if (num == 1)
        return true;

    int x = num % 10;
    if (!(num % 5))
        return isU(num / 5);
    x = num % 9;
    if (!(num % 3))
        return isU(num / 3);
    if (!(num & 1))
        return isU(num >> 1);
    return false;
}

bool isUgly(int num) {
    if (!num)
        return false;
    return isU(num);
}

