void test_permutation_no_dup(int* n, int s, int e)
{
    if (s > e)
        out(n, e + 1);
    else
    {
        for (int i = s; i <= e; i ++)
        {
            int t = n[i];
            n[i] = n[s];
            n[s] = t;
            test_permutation_no_dup(n, s + 1, e);
            n[s] = n[i];
            n[i] = t;
        }
    }
}


void test_permutation_with_dup(int* n, int s, int e)
{
    if (s > e)
        out(n, e + 1);
    else
    {
        for (int i = s; i <= e; i ++)
        {
            bool done = false;
            for (int j = s; j < i; j ++)
            {
                if (n[j] == n[i])
                {
                    done = true;
                    break;
                }
            }
            if (done)
                continue;

            int t = n[i];
            n[i] = n[s];
            n[s] = t;
            test_permutation_with_dup(n, s + 1, e);
            n[s] = n[i];
            n[i] = t;
        }
    }
}

